import React from 'react';

const About = () => (
  <section className="about" id="about">
    <h2>About Me</h2>
    <p>
      A proactive and ambitious Computer Science student with strong skills in Java, Python, and C#, and hands-on experience with Git, SQL, and cloud tools. Currently developing web development expertise in HTML, CSS, and JavaScript, with plans to learn Node.js. Actively engaged in projects, hackathons, and coding competitions, demonstrating problem-solving abilities and a passion for learning new technologies to build impactful software solutions.
    </p>
  </section>
);

export default About;
